import axios from "axios";
import React, { useEffect, useState } from "react";
// import "./All.css";
// import AiOutlineArrowLeft from 'react-icons/AiOutlineArrowLeft'
import { AiOutlineArrowLeft } from "react-icons/ai";
import url from "../host";

export default function Manager() {
  const [data, setData] = useState([]);
  useEffect(() => {
    var tokenUser = localStorage.getItem("token");
    axios
      .get(`${url}/api/myzakaz`, {
        headers: { Authorization: "Bearer: " + tokenUser },
      })
      .then((res) => {
        setData(res.data);
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  function handlePress() {
    document.querySelector(".MainS").style = "display: none";
    document.querySelector(".opacityDiv").style = "display: block";
  }

  function handlePress2() {
    document.querySelector(".MainS").style = "display: block";
    document.querySelector(".opacityDiv").style = "display: none";
  }
  function handlePress3() {
    document.querySelector(".addOrder").style = "display: block;";
  }
  function handlePress4() {
    document.querySelector(".addOrder").style = "display: none;";
  }
  function handlePress5() {
    // var tokenUser = localStorage.getItem("token");
    // console.log(tokenUser);
    // var data = new FormData();
    // data.append("trek_id", document.querySelector(".trackId").value);
    // data.append("sender", localStorage.getItem("id"));
    // axios
    //   .post(`${url}/api/orders`, data, {
    //     headers: { Authorization: "Bearer: " + tokenUser },
    //   })
    //   .then((res) => {
    //     document.querySelector(".addOrder").style = "opacity: 0;";
    //     alert("succes");
    //   })
    //   .catch((err) => {
    //     console.log(err);
    //   });
    var data = new FormData();
    data.append("menegerid", document.querySelector(".select1").value);
    data.append("deckription", document.querySelector(".textarea").value);
    data.append("creator", localStorage.getItem("id"));
    data.append(
      "oredersid",
      JSON.parse(document.querySelector(".select2").value).id
    );
    data.append("status", 1);
    data.append("adressuser", target);

    axios
      .post(`${url}/api/zakaz`, data, {
        headers: { Authorization: "Bearer: " + localStorage.getItem("token") },
      })
      .then((res) => {
        alert("succes");
        // window.location.reload();
        axios
          .post(
            `${url}/api/points`,
            {
              status: 1,
              zakaz_id: res.data.id,
            },
            {
              headers: {
                Authorization: "Bearer: " + localStorage.getItem("token"),
              },
            }
          )
          .then((res2) => {
            console.log(res2.data);
          })
          .catch((err) => {
            console.log(err);
          });
        // document.querySelector(".addOrder").style = "opacity: 0;";
      })
      .catch((err) => {
        console.log(err);
      });
  }
  return (
    <div style={{ width: "100%" }}>
      <div className="opacityDiv">
        <h4 onClick={() => handlePress2()}>
          <AiOutlineArrowLeft style={{ fontSize: 30, cursor: "pointer" }} />
        </h4>
        <h1 style={{ marginLeft: "10%" }}>Обновить заказ</h1>
        <div style={{ paddingLeft: 140 }}>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Отправитель</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>Получатель</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
              // height: 120
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Адрес</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>Адрес</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
            }}
          >
            <div style={{ width: "40%" }}>
              <span>Трек-код</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
            <div style={{ width: "40%" }}>
              <span>email</span>
              <br />
              <input
                type="text"
                style={{
                  width: "100%",
                  height: 40,
                  borderRadius: 3,
                  border: "1px solid gray",
                  marginTop: 10,
                }}
              />
            </div>
          </div>
          <button
            style={{
              background: "#800000",
              border: "none",
              height: 40,
              borderRadius: 5,
              color: "white",
              fontWeight: "400",
              fontSize: 17,
              marginLeft: 50,
              marginTop: 10,
            }}
          >
            Обновить заказ
          </button>
        </div>
      </div>
      <div className="addOrder">
      <AiFillCloseCircle
        className="iconCLose"
        onClick={() => handlePress4()}
      />
      <textarea
        style={{ maxWidth: "98%", minWidth: "98%", marginTop: 10 }}
        placeholder="desckription"
        className='textarea'
      />
      <select
